%% main.m - Q-learning 综合实验 (可视化增强版)
% 结合了 GridWorld 的环境绘图和 RLVisualizer 的数据曲线绘图
clear; close all; clc;

% ==========================================
% 1. 环境与参数初始化
% ==========================================
x_len = 5; y_len = 5;
start = [1, 1]; final = [3, 4];
obs = [2,2; 3,2; 3,3; 2,4; 4,4; 2,5];
env = GridWorld(x_len, y_len, start, final, obs);

% 实验超参数
episodes = 800;      % 训练回合数
max_steps = 500;      % 单回合最大步数
alpha = 0.1;         % 学习率
gamma = 0.9;         % 折扣因子
epsilon_init = 0.6;  % 初始探索率

% ==========================================
% 2. 获取 Ground Truth (用于计算 Value Error)
% ==========================================
fprintf('正在计算 Ground Truth (V*) ...\n'); %[output:3d0f9d38]
pi_agent = PolicyIterationAgent(env.State_Space_Size, 5, gamma, 100, 10);
pi_agent.train(env); %[output:7c900eb5]
[V_star, ~] = pi_agent.get_results();
env.plot_values(V_star) %[output:72b80bc8]

%% === 实验 A: Algo 7.2 (On-policy) ===
fprintf('\n>>> Running Algo 7.2 (On-policy) <<<\n'); %[output:130309ba]
agent_on = Qlearning(env.State_Space_Size, 5, alpha, gamma, epsilon_init, '7.2_on_policy');
agent_on.train(env, episodes, max_steps, V_star); %[output:61ba2fbd]

% 基础可视化
RLVisualizer.plot_rewards(agent_on.History_Reward, 'Algo 7.2 (On-policy)'); %[output:164c1ad9]
RLVisualizer.plot_steps(agent_on.History_Steps, 'Algo 7.2 (On-policy)'); %[output:8df6098d]
RLVisualizer.plot_error(agent_on.History_Error, 'Algo 7.2 (On-policy)'); %[output:9f8302e0]
env.plot_policy_matrix(agent_on.get_policy_probs()); title('Algo 7.2: Policy'); %[output:2e49b98c]
env.plot_values(agent_on.get_state_values()); title('Algo 7.2: Values'); %[output:575bf8b6]
env.plot_policy(agent_on.get_deterministic_policy()); title('Algo 7.2: Greedy Policy'); %[output:1c27d6f7]

% [新增] 学习过程可视化：展示 200 个回合的探索轨迹
fprintf('Generating stochastic exploration trajectories (200 episodes)...\n'); %[output:38053c0f]
test_env = GridWorld(x_len, y_len, start, final, obs);
test_agent = Qlearning(test_env.State_Space_Size, 5, alpha, gamma, epsilon_init, '7.2_on_policy');
histories_on = {};

% 使用你提供的逻辑进行在线收集
for i = 1:200
    % 使用 fixed_length 模式 (50步) 收集
    s = test_env.coord2idx(start);
    path = [s];
    
    % 在收集的同时进行 update，这样可以看到轨迹从混乱到有序的变化
    % 注意：这里手动展开了 train 的逻辑以便收集 path
    curr_s = s;
    curr_a = test_agent.choose_action_epsilon_greedy(curr_s);
    
    for k = 1:50
        [ns, r, ~] = test_env.step(curr_s, curr_a);
        
        % Sarsa Update (因为是 On-policy 演示)
        next_a = test_agent.choose_action_epsilon_greedy(ns);
        
        % Q Update
        target = r + gamma * test_agent.Q_Table(ns, next_a); % Sarsa target
        test_agent.Q_Table(curr_s, curr_a) = test_agent.Q_Table(curr_s, curr_a) + alpha * (target - test_agent.Q_Table(curr_s, curr_a));
        
        curr_s = ns;
        curr_a = next_a;
        path(end+1) = curr_s;
    end
    
    histories_on{end+1} = path;
    
    % 简单的衰减
    test_agent.Epsilon = max(0.01, test_agent.Epsilon * 0.99);
end

% 调用接口绘制
test_env.plot_stochastic_trajectory(histories_on); %[output:8364d3bc]
title('Algo 7.2: Online Exploration Process (200 Episodes)'); %[output:8364d3bc]


%% === 实验 B: Algo 7.3 (Off-policy) ===
fprintf('\n>>> Running Algo 7.3 (Off-policy) <<<\n'); %[output:12b8b926]
agent_off = Qlearning(env.State_Space_Size, 5, alpha, gamma, epsilon_init, '7.3_off_policy');
agent_off.train(env, episodes, max_steps, V_star); %[output:806b75bf]

% 基础可视化
RLVisualizer.plot_rewards(agent_off.History_Reward, 'Algo 7.3 (Off-policy)'); %[output:83cbc8b9]
RLVisualizer.plot_steps(agent_off.History_Steps, 'Algo 7.3 (Off-policy)'); %[output:14867728]
RLVisualizer.plot_error(agent_off.History_Error, 'Algo 7.3 (Off-policy)'); %[output:148fe4c1]
env.plot_policy_matrix(agent_off.get_policy_probs()); title('Algo 7.3: Policy'); %[output:4c5a715f]
env.plot_values(agent_off.get_state_values()); title('Algo 7.3: Values'); %[output:7dc7f99d]
env.plot_policy(agent_off.get_deterministic_policy()); title('Algo 7.3: Greedy Policy'); %[output:80742707]

% [新增] 学习过程可视化
fprintf('Generating stochastic exploration trajectories (200 episodes)...\n'); %[output:14b426ad]
test_env_off = GridWorld(x_len, y_len, start, final, obs);
test_agent_off = Qlearning(test_env_off.State_Space_Size, 5, alpha, gamma, 1.0, '7.3_off_policy'); % Epsilon=1.0 for random behavior
histories_off = {};

for i = 1:200
    s = test_env_off.coord2idx(start);
    path = [s];
    
    % Off-policy: 行为策略是随机的
    for k = 1:50
        a = randi(5); % Random behavior
        [ns, r, ~] = test_env_off.step(s, a);
        
        % Q-Learning Update
        max_q = max(test_agent_off.Q_Table(ns, :));
        test_agent_off.Q_Table(s, a) = test_agent_off.Q_Table(s, a) + alpha * (r + gamma * max_q - test_agent_off.Q_Table(s, a));
        
        s = ns;
        path(end+1) = s;
    end
    histories_off{end+1} = path;
    % Off-policy 通常不衰减行为策略的 epsilon，保持随机探索
end

test_env_off.plot_stochastic_trajectory(histories_off); %[output:2ea61eaa]
title('Algo 7.3: Online Exploration Process (Random Behavior)'); %[output:2ea61eaa]

fprintf('\nDone.\n'); %[output:1adafc04]


